function lengthOfLongestSubstring(s: string): number {

    let longest = 0;
    const mapFreq = new Array(200).fill(0);

    let i = 0;
    for (let j = 0; j < s.length; j++) {

        const iCharCode = s.charCodeAt(j)
        mapFreq[iCharCode] += 1;

        while (mapFreq[iCharCode] > 1) {
            mapFreq[s.charCodeAt(i)] -= 1;
            i += 1;
        }

        longest = Math.max(longest, (j - i) + 1)

    }

    return longest;
}


